import React, { useState } from "react";
import TopNav from '../components/Navbar/TopNav';
import Categories from "../components/Categories";
import ShowPlants from "../components/ShowPlants";

const Main = () => {
  const [filterPlantName, setFilterPlantName] = useState("");
  const [searchQuery, setSearchQuery] = useState("");

  return (
    <div className='full_div'>
      <TopNav />

      <div style={{ display: 'flex', width: '100%' }}>
        <Categories setFilterPlantName={setFilterPlantName} searchQuery={searchQuery} />
        <ShowPlants filterPlantName={filterPlantName} filterVendorName={null} searchQuery={searchQuery} />
      </div>

      <div style={{ width: '100%', height: '100px', backgroundColor: '#6B8E23' }}></div>
    </div>
  );
}

export default Main;
